  fontSizeMapper = word => Math.log2(word.value) * 10;

  getWordCloudData() {
    const res = [];
    for (let [key, value] of Object.entries(this.data)) {
      res.push({
        'text': key,
        'value': value.data_len
      })
    }
    return res;
  }

  onWordClick = (word) => {
    this.setState({...this.state, traits: this.data[word.text].data });
    this.forceUpdate();
  }

  componentDidUpdate() {
  }

  render() {
    const traits  = this.state.traits;

    return (
      <div className='App'>
      <div className='App-header'>
        <h2>Human chromosome 20</h2>
      </div>

      <div id='mainframe'>

      <BarChart size={[400, 500]}/>

      <WordCloud data={this.getWordCloudData()}
                   fontSizeMapper={this.fontSizeMapper}
                   width={400}
                   height={550}
                   onWordClick={this.onWordClick}
                   ref= { node =>  this.node  = node }
      />

      <List>
      { traits.forEach(listValue =>  {  <List.Item> {listValue} </List.Item> } ) }
      </List>

      </div>
      </div>
    );
  }
